/* eslint-disable func-style */
/* eslint-disable max-len */
/* eslint-disable require-jsdoc */
function addToolbox () {

    const QH_ADVANCED_ICO = "data:image/svg+xml;charset=utf-8;base64,";

    return `
<category name="%{BKY_QH_ADVANCED_CATEGORY}" id="QH_ADVANCED_CATEGORY" colour="#42CCFF" secondaryColour="#42CCFF" iconURI="${QH_ADVANCED_ICO}">
    <block type="try_except_else_finally"></block>
    <block type="controls_pass"></block>
    <block type="PY_time_ticks"></block> 
    <block type="python_in">
        <value name="val">
            <shadow type="math_number">
                <field name="NUM">0</field>
            </shadow>
        </value>
    </block>
    <block type="python_del"></block>
    <block type="system_reset"></block>
    <block type="controls_flow_statements"></block>
    <block type="controls_thread">
        <value name="arg">
            <shadow type="text">
              <field name="TEXT">"helloworld",10</field>
            </shadow>
        </value>
    </block>
    <block type="thread_func">
        <value name="arg">
            <shadow type="text">
              <field name="TEXT">text,num</field>
            </shadow>
        </value>
    </block>
    <block type="controls_exec">
        <value name="arg">
            <shadow type="text">
              <field name="TEXT">test.py</field>
            </shadow>
        </value>
    </block>
    <block type="controls_range">
        <value name="FROM">
          <shadow type="math_number">
            <field name="NUM">0</field>
          </shadow>
        </value>
        <value name="TO">
          <shadow type="math_number">
            <field name="NUM">5</field>
          </shadow>
        </value>
        <value name="STEP">
          <shadow type="math_number">
            <field name="NUM">1</field>
          </shadow>
        </value>
    </block>
    <block type="controls_forEach">
        <value name="LIST">
          <block type="controls_range">
            <value name="FROM">
              <shadow type="math_number">
                <field name="NUM">0</field>
              </shadow>
            </value>
            <value name="TO">
              <shadow type="math_number">
                <field name="NUM">5</field>
              </shadow>
            </value>
            <value name="STEP">
              <shadow type="math_number">
                <field name="NUM">1</field>
              </shadow>
            </value>
          </block>
        </value>
        <value name="VAR">
          <block type="py_variables">
            <value name="name">
                <shadow type="text">
                  <field name="TEXT">i</field>
                </shadow>
            </value>
          </block>
        </value>
    </block>
</category>
`;

}

exports = addToolbox;
